import './App.css';

class App extends Component {
  render(){
    return (
      <div className="App">
        <div className="App__Form"></div>
        <div className="App__Aside">
          <div className="PageSwitcher">
            <a href="#" className="PageSwitcher__Item ">Sign In</a>
            <a href="#" className="PageSwitcher__Item PageSwitcher__Item--Active">Sgin Up</a>
          </div>

        <div className="FromTitle">
          <a href="#" className="FromTitle__Link">Sgin In</a> or
          <a href="#" className="FromTitle__Link FormTitle__Link--Active">Sgin Up</a>
        </div>

        </div>
      </div>
    )
  }

}

export default App;
